import React from 'react';
import '../css/login.css';

//login page

function Login() {
    return (
        <div class='form-page'>
            <div class='form-box'>
                <h2>Log In</h2><hr style={{border:'2px solid white'}}/>
            </div>
        </div>
    );
}

export default Login;
